import image from '../assets/ecommerce-gd190ac368_1920.jpg';
import '../App.css';
import Products from './Products';
import ProductsHeading from './ProductsHeading';

function Home() {
    return (
        <>
            <div className='image'>
                <img src={image} className='home-image'></img>
            </div>
            <div className='products'>

                <ProductsHeading title='Latest Products'/>
            </div>
        </>
    )
}

export default Home
